import { useState } from "react";
import "./GenreListItem.css";
export default function GenreListItem(props) {
  return (
    <button
      onClick={(() => getGenreFilter(), console.log(genreFilter))}
      className="genreDropboxItem"
    >
      {props.genreName}
    </button>
  );
}
